/*Table structure for table `maillimits` */

DROP TABLE IF EXISTS `maillimits`;

CREATE TABLE `maillimits` (
  `smail_id` varchar(200) DEFAULT NULL COMMENT '发送邮件主键',
  `subject` varchar(500) DEFAULT NULL COMMENT '邮件主题',
  `rmail_id` varchar(200) DEFAULT NULL COMMENT '接受邮件主键',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `is_first_open` int(11) DEFAULT NULL COMMENT '0是，1不是',
  `opentime` datetime DEFAULT NULL COMMENT '打开时间',
  `ip` varchar(200) DEFAULT NULL COMMENT '浏览ip',
  `batchnumber` varchar(200) DEFAULT NULL COMMENT '批次号',
  `sendtime` datetime DEFAULT NULL COMMENT '发送时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=146 DEFAULT CHARSET=utf8;

