/*Table structure for table `mailreceipt` */

DROP TABLE IF EXISTS `mailreceipt`;

CREATE TABLE `mailreceipt` (
  `rmail_id` int(11) DEFAULT NULL COMMENT '接受方邮件主键',
  `sendtime` datetime DEFAULT NULL COMMENT '发送时间',
  `smail_id` int(11) DEFAULT NULL COMMENT '发送方邮件主键',
  `status` int(11) DEFAULT NULL COMMENT '是否发送成功,0失败,1成功',
  `remark` varchar(500) DEFAULT NULL COMMENT '状态描述',
  `createtime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rmail_address` varchar(300) DEFAULT NULL COMMENT '接收方邮件地址',
  `smail_address` varchar(300) DEFAULT NULL COMMENT '发送方邮件地址',
  `batchnumber` varchar(200) DEFAULT NULL COMMENT '批次号(每次发送任务的唯一代号)',
  `subject` varchar(500) DEFAULT NULL COMMENT '邮件主题',
  `uniquemailid` varchar(300) DEFAULT NULL COMMENT '唯一号，',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mailreceipt` */

/*Table structure for table `mailtask` */

DROP TABLE IF EXISTS `mailtask`;

CREATE TABLE `mailtask` (
  `mailsum` int(11) DEFAULT NULL,
  `sented` int(11) DEFAULT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务号',
  `percentage` varchar(300) DEFAULT NULL COMMENT '百分比',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mailtask` */

/*Table structure for table `pus_dept` */

DROP TABLE IF EXISTS `pus_dept`;

CREATE TABLE `pus_dept` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) DEFAULT NULL,
  `pid` int(11) DEFAULT NULL,
  `deptgrade` int(11) DEFAULT NULL,
  `description` varchar(500) DEFAULT NULL,
  `createtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

