/*Table structure for table `seqs` */

DROP TABLE IF EXISTS `seqs`;

CREATE TABLE `seqs` (
  `goodsnum` varchar(200) DEFAULT NULL COMMENT '货号索引',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `salesnum` varchar(200) DEFAULT NULL COMMENT '销售合同号索引',
  `cknum` varchar(200) DEFAULT NULL COMMENT '出库单号索引',
  `cgnum` varchar(200) DEFAULT NULL COMMENT '采购合同索引',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

