/*Table structure for table `studentinfos` */

DROP TABLE IF EXISTS `studentinfos`;

CREATE TABLE `studentinfos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `createdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `schoolnumber` varchar(50) DEFAULT NULL COMMENT '学校标识码',
  `name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `sex` int(11) NOT NULL COMMENT '0,女，1，男',
  `birthday` varchar(50) DEFAULT NULL COMMENT '出生日期',
  `age` int(11) NOT NULL COMMENT '年龄',
  `borncode` varchar(50) DEFAULT NULL COMMENT '出生地行政区划代码',
  `origin` varchar(50) NOT NULL COMMENT '籍贯',
  `nation` varchar(50) NOT NULL COMMENT '民族',
  `nationality` varchar(50) DEFAULT NULL COMMENT '国家',
  `idno` varchar(50) DEFAULT NULL COMMENT '身份证件号',
  `hkproperties` int(11) DEFAULT NULL COMMENT '0,非农业户口，1农业户口',
  `accountcode` varchar(50) DEFAULT NULL COMMENT '户口所在地行政区划',
  `classnumber` varchar(50) DEFAULT NULL COMMENT '班号',
  `admissiondate` varchar(50) DEFAULT NULL COMMENT '入学年月',
  `entrance` varchar(50) DEFAULT NULL COMMENT '入学方式',
  `readmode` varchar(50) DEFAULT NULL COMMENT '就读方式',
  `address` varchar(200) DEFAULT NULL COMMENT '现住址',
  `mailingaddress` varchar(200) DEFAULT NULL COMMENT '通信地址',
  `homeaddress` varchar(200) DEFAULT NULL COMMENT '家庭地址',
  `telnumber` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `postalcode` varchar(50) DEFAULT NULL COMMENT '邮政编码',
  `is_dsz` int(11) DEFAULT NULL COMMENT '0不是独生子，1是独生子',
  `is_pre_education` int(11) DEFAULT NULL COMMENT '0，没有接受过学前教育，1接受过学前教育',
  `is_lschildren` int(11) DEFAULT NULL COMMENT '0,不是留守儿童，1是留守儿童',
  `is_apply` int(11) DEFAULT NULL COMMENT '0，否，1是 ；是否需要申请资助',
  `is_enjoya` int(11) DEFAULT NULL COMMENT '0,否，1是；是否享受一补',
  `is_orphan` int(11) DEFAULT NULL COMMENT '0,否，1是；是否孤儿',
  `is_special` int(11) DEFAULT NULL COMMENT '0,否，1是；是否烈士或优抚子女',
  `sxjl` varchar(50) DEFAULT NULL COMMENT '上下学距离',
  `sxxfs` varchar(50) DEFAULT NULL COMMENT '上下学方式',
  `sxczxc` int(11) DEFAULT NULL COMMENT '0，否，1是；是否需要乘坐校车',
  `oldname` varchar(50) DEFAULT NULL COMMENT '曾用名',
  `idnotime` varchar(50) DEFAULT NULL COMMENT '身份证件有效期',
  `bloodtype` varchar(50) DEFAULT NULL COMMENT '血型',
  `specialty` varchar(100) DEFAULT NULL COMMENT '特长',
  `stunumber` varchar(50) DEFAULT NULL COMMENT '学籍辅号',
  `stuid` varchar(50) DEFAULT NULL COMMENT '班内学号',
  `source` varchar(50) DEFAULT NULL COMMENT '学生来源',
  `email` varchar(50) DEFAULT NULL COMMENT '电子信箱',
  `mainurl` varchar(50) DEFAULT NULL COMMENT '主页地址',
  `disability_type` varchar(50) DEFAULT NULL COMMENT '残疾类型',
  `is_governmentbuuy` int(11) DEFAULT NULL COMMENT '0,否，1是；是否由政府购买学位',
  `sdjd` varchar(50) DEFAULT NULL COMMENT '随班就读',
  `membersname1` varchar(50) DEFAULT NULL COMMENT '成员1姓名',
  `membersrelations1` varchar(50) DEFAULT NULL COMMENT '成员1关系',
  `membersaddress1` varchar(200) DEFAULT NULL COMMENT '成员1现住址',
  `membersresidencecode1` varchar(50) DEFAULT NULL COMMENT '成员1户口所在地行政区划',
  `memberstel1` varchar(50) DEFAULT NULL COMMENT '成员1联系电话',
  `members_isguardian1` int(11) DEFAULT NULL COMMENT '0,否，1是；成员1是否监护人',
  `membersidnotype1` varchar(50) DEFAULT NULL COMMENT '成员1身份证件类型',
  `membersidno1` varchar(60) DEFAULT NULL COMMENT '成员1身份证件号',
  `membersnation1` varchar(50) DEFAULT NULL COMMENT '成员1民族',
  `membersworkunit1` varchar(200) DEFAULT NULL COMMENT '成员1工作单位',
  `memberspost1` varchar(50) DEFAULT NULL COMMENT '成员1职务',
  `membersname2` varchar(50) DEFAULT NULL,
  `membersrelations2` varchar(50) DEFAULT NULL,
  `membersaddress2` varchar(200) DEFAULT NULL,
  `membersresidencecode2` varchar(50) DEFAULT NULL,
  `memberstel2` varchar(50) DEFAULT NULL,
  `members_isguardian2` int(11) DEFAULT NULL,
  `membersidnotype2` varchar(50) DEFAULT NULL,
  `membersidno2` varchar(50) DEFAULT NULL,
  `membersnation2` varchar(50) DEFAULT NULL,
  `membersworkunit2` varchar(200) DEFAULT NULL,
  `memberspost2` varchar(50) DEFAULT NULL,
  `is_workersbaby` int(11) DEFAULT NULL COMMENT '0,否，1是；是否进城务工人员随迁子女',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=449 DEFAULT CHARSET=utf8;

