/*Table structure for table `sysuser_loginlog` */

DROP TABLE IF EXISTS `sysuser_loginlog`;

CREATE TABLE `sysuser_loginlog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `useraccount` varchar(200) NOT NULL COMMENT '帐号',
  `type` int(11) NOT NULL COMMENT '操作类型:0登录，1退出',
  `ip` varchar(200) NOT NULL COMMENT '操作ip',
  `createtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
